INSERT INTO `input` VALUES ('309', '苏   砍', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.10', '089979', '1、首页中血型未填；2、低血钾未处理；3、首程中未写鉴别诊断；4、诊疗计划漏写心电监护、吸氧；5、部分病程记录T、P、血氧饱和度无记录；6、CT报告未见正式报告单；7、医嘱未顶格书写；8、入院记录有空格；9、开放性颅脑损伤应为易感因素，院感表中未填。', null, '89分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('310', '叶江文', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.10', '0810406', '1、首页中出院诊断处空格；2、医院感染名称写“未发现”，病历诊断写“未做”，均应填“/”；3、首程存在拷贝现象；4、上级医师查房对病情分析不足。', null, '92分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('311', '潘   凡', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.10', '0810695', '1、入院记录第一页有空格；2、首程拷贝现病史，无病例特点；3、9.16上级医师查房分析意见重点不突出；4、9.21同一时间8：40开两次三级护理，未分析；5、9.22医嘱取消不规范；6、患者已于9.20做大便常规检查，9.23病程记录及出院记录中仍叫患者签字拒绝大便常规检查。', null, '89分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
