INSERT INTO `input` VALUES ('461', '黄   教', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811626', '1、该患儿10个月大，诊断为婴幼儿腹泻并脱水，体检中少头颅前后囟情况；2、诊断为婴幼儿腹泻并轻度脱水，不确切，应为“婴儿腹泻并中度脱水”，诊断依据“口唇粘膜干燥，双眼眶凹陷，少尿”；3、上级医师查房分析过简，如腹泻病因，发病机制，并发症等。', null, '不合格', '0', '83ced975-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('462', '邓玉林', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811605', '1、首程中现病史描述前后矛盾（前写少许口吐白沫，后写口吐白沫无明显好转）；2、首程中阴性症状描述简单；3、主诉重点不准确（应写误吸入多长时间，而写口吐白沫半小时）；4、诊断依据不精练；5、为什么要洗胃、使用VitK、多巴胺？', null, '不合格', '0', '83ced975-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('463', '朱冰封', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811455', '1、病程中苯巴比妥是酶诱导剂，其作用机制不是减少肝肠循环；2、新生儿重度窒息，应用纳洛酮疗程3-5天，病程7天未停用；3、入院时二氧化碳结合力异常未复查。', null, '不合格', '0', '83ced975-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('464', '黄献来', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811362', '1、首程缺“病例特点”字样；2、诊疗计划过简。', null, '不合格', '0', '83cef34d-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('465', '黄献来', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811522', '1、患者10：15入院，首程时间写“9：50”，2、首程不能体现病史特点；3、高血压病程及术前小结未提及，会诊记录缺；4、开博通未写化学名；5、挤压症（-），不规范。', null, '不合格', '0', '83cef34d-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('466', '李根智', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811592', '1、首程中查体冗长；2、主治医师查房无诊断依据，相关鉴别诊断及具体诊疗计划；3、一条医嘱多项内容。', null, '不合格', '0', '83cef34d-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('467', '胡   睿', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811421', '1、首程中未写“病例特点”；2、缺鉴别诊断；3、缺病程一次；4、手术同意书无上级医师签名；5、术前讨论中记录者未手写签名；6、手术后，住院病历诊断仍写为“腹痛待查”。', null, '不合格', '0', '83cef34d-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('468', '胡   睿', '621da9c2-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811527', '1、首程中病史未摘要，拷贝现病史，诊断依据中辅助检查写“同前”；2、术前小结缺项；3、术后记录缺术后注意事项；4、手术记录欠详。', null, '不合格', '0', '83cef3ac-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('469', '刘才文', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811316', '1、首程无“病例特点”；2、存在拷贝现象；3、糖尿病患者清淡饮食是否合理？（应写糖尿病饮食，清淡饮食应规范写为低脂饮食）；4、“肌张力稍增强”，不规范；5、长春西汀、肌氨肽苷无剂量；6、住验证患者或家属未签名。', null, '不合格', '0', '83cedff3-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('470', '刘才文', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811324', '1、首程中病例特点欠突出；2、首程中肾性高血压的鉴别要点为：血压增高明显，降压药物治疗效果治疗不好，腹部和腰背部肾区血管杂音，影像学为彩超、CT等肾动脉狭窄；2、病程记录少对实验室检查结果异常的分析、记录。', null, '不合格', '0', '83cedff3-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('471', '刘才文', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811325', '1、病程中无病史特点分析；2、10.2、10.3病程拷贝；3、病历与病程拷贝。', null, '不合格', '0', '83cedff3-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('472', '彭永挑', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811224', '1、诊疗计划中欠改善微循环、抗凝、营养神经；2、病程中9.28入院血压210/100mmHg，直到10.3病程中才出现血压160/90mmHg，期间改过降压药，未分析记录。', null, '不合格', '0', '83cedff3-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('473', '刘汉桃', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811280', '1、现病史中未描述门诊诊疗情况；2、入院诊断未及时补充；3、电解质异常未分析；3、体格检查不完整；4、报告粘贴单患者姓名住院号未填。', null, '不合格', '0', '83cedff3-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('474', '付保忠', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0810991', '1、升结肠癌患者诊疗计划中是否需要提及“手术问题”；2、“病史特点”应为“病例特点”；3、有输血病程中无记录；4、医患协议书：谈话医师未签名，一般项目填写不全；5、医嘱书写行空格不统一；6、首页未填写；7、奥美拉唑未写剂型；8、血红蛋白56.09/L，入院病历诊断失血性贫血（重度），病程诊断为中度；9、住院证经办人、患者或家属未签名；10、吸氧无流量。', null, '不合格', '0', '83cee87a-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('475', '赖松银', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811567', '1、病史中血糖8.12mmol/L未注明在何种情况下所测，也未分析；2、B超示：肝囊肿，异性上腹部CT及CEA、AFP检查，但未定期复查；3、医嘱书写主次不分明。', null, '不合格', '0', '83cee87a-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('476', '鲁   威', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811464', '1、首程中病史特点描述欠简洁，重点欠突出，如大量饮酒后出现上腹部持续性疼痛，查体脐周有压痛，血液淀粉酶明显增高，血象高，有低脂血症等；2、首程中鉴别诊断未与急性胃炎、急性心梗相鉴别；3、诊疗计划不详细，禁食还要禁饮；4、各级医师查房欠缺对急性胰腺炎病情程度的分析、描述，鉴别诊断未与胃及心脏疾病鉴别；5、对实验室检查结果的分析无记录或无分析，如低脂血症等；6、两年前已诊断为急性胰腺炎，此次入院应诊断为慢性胰腺炎急性发作。', null, '不合格', '0', '83cee87a-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('477', '鲁   威', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811547', '1、首程中未考虑胸背部疼痛的鉴别诊断；2、尿常规见隐血，考虑标本污染（标本污染有血还是白细胞？）；3、胸片：病历中未描述骨折结果；4、入院诊断不全（高脂血症、骨折）；5、疼痛症状在10.8、10.9的病程记录中未描述。', null, '不合格', '0', '83cee87a-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('478', '鲁   威', '621da91a-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.10', '0811554', '1、眼科会诊意见病程未体现，缺会诊诊断分析；2、10.8医嘱中请康复科会诊，但无会诊记录及会诊记录单；3、病程存在拷贝现象；4、医患协议书未签名；5、病案首页空白。', null, '不合格', '0', '83cee87a-61e7-11e2-975d-5cff350bc903');
