INSERT INTO `input` VALUES ('534', '潘   凡', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '088039', '1、首页涂改多处；2、月经史书写不完整；3、首程病史完全粘贴现病史；4、诊疗计划过简，未写具体的药物、剂量及用法；5、有行导尿，但院感记录单未写。', null, '92.2分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('535', '叶江文', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '088815', '1、现病史描述简单；2、首程中完善相关检查未写出具体内容；3、病程记录及上级医师查房记录分析欠详。', null, '96分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('536', '林建滨', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '089055', '1、出院诊断无上级医师签名；2、首程及病程有明显拷贝现象；3、上级医师查房及病程记录分析记录过简。', null, '93分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('537', '潘   凡', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '089284', '1、首程拷贝现病史；2、“生理盐水”、“双氧水”未用通用名；3、出院诊断无上级医师签字；4、院感漏写易感因素及侵袭性操作；5、评分表不规范。', null, '93分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('538', '苏   砍', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '088539', '1、现病史漏字；2、意识朦胧体检写“无压痛、无叩痛”，不真实；3、首程中“长度”写为“长都”多处；4、7.24  9：00病程记录“呼吸困难”写为“呼吸困囊”；5、7.24  12：00病程记录“迟发出血”写为“迟发出现”；6、病程记录中“mmHg”写为“mmnHg”；7、术前小结无上级医师签字；8、副主任医师查房两次未签名；9、7.24临时医嘱无有执业资格医师签字（至少5处）；10、7.25临时医嘱无医师签字一次；11、更换抗生素未说明理由；12、头孢西丁钠使用时间过长7天（7.24-7.31）；13、8.4-8.11（7天内）无上级医师查房；14、输血治疗同意书输血前检查空缺；15、病情知情同意书未签“同意”及日期，也无医师签名，且为非委托人签字；16、授权委托书不规范，无身份证号码；17、7.24手术知情同意书无医师签字；18、7.31手术同意书为非委托人签名；19、术前Hb123g/L，术中出血800ml，非输血适应症且未复查血常规；20、住院病案质量评定表空，未质控；21、首页确诊日期未填。（乙级）', null, '73.5分  乙级', '扣0.3分', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('539', '张桂坤、舒诗军', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.09', '088629', '1、缺月经史；2、入院记录体检多处空项（超过20项）；3、神志朦胧患者体检写“腹部无压痛、肝区无叩击痛”等，不真实；4、左肩胛下角骨折诊断不及时；5、“术前小结”写为“术前记录”，且无医师签字；6、7.29-8.3（6天）无上级医师查房；7、最后一次病程记录无出院诊断及出院医嘱；8、抗生素使用不合理；9、化验单粘贴不规范；10、出院记录主治医师、实习医师、填写时间栏空缺；11、入院记录未写出院诊断；12、8.5请麻醉科会诊，但麻醉科医师会诊栏空项（8.5有签麻醉同意书）；13、患者自动出院无病情告知及患者和家属签字（病程中有写）；14、无院感表中有易感因素及侵袭性操作未填。（神外转骨二）（乙级）', null, '79.5分/55分  乙级', '扣0.3分', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('540', '蔡河清', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3d46-61e5-11e2-975d-5cff350bc903', '2008.09', '089297', '1、语句简化，写“无扣浊”；2、肛门、外生殖器未见；3、使用头孢西丁钠时间过长（7天），且未复查血常规；4、签名字迹潦草，无法辨认。', null, '94分', '0', '83d12eff-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('541', '刘丽玉', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3b22-61e5-11e2-975d-5cff350bc903', '2008.09', '088232', '1、现病史中发病后一般情况未描述；2、体检缺有鉴别意义的阴性体征；3、病程记录分析记录过简。', null, '94分', '0', '83d11f9f-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('542', '彭永挑', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.09', '089231', '1、现病史中原诊治过程记叙不清；2、体检遗漏有鉴别意义的阴性体征；3、病程记录上级医师查房分析记录欠详；4、医嘱部分涂改。', null, '92分', '0', '83cedb94-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('543', '刘才文', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.09', '089239', '1、现病史中原诊治过程记叙不清；2、病程分析不够严密；3、病程记录分析记录过简；4、诊断依据不足，“肺炎”、“慢支并感染”同时诊治。', null, '92分', '0', '83cedb94-61e7-11e2-975d-5cff350bc903');
