INSERT INTO `input` VALUES ('797', '叶先龙', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.08', '086401', '1、首页中中老年胃炎应随访；2、现病史腹痛描述简单，体重下降不明显表述不确切，既往史用“素健”；3、体检描述欠规范，如“听力粗试正常”；4、漏诊“窦性心动过缓”；5、诊疗计划欠详；6、病程记录上级医师查房分析过简；7、心电图异常无诊断、分析、处理。', null, '85分', '0', '83cee2e7-61e7-11e2-975d-5cff350bc903');
