INSERT INTO `input` VALUES ('1187', '李春阳', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.07', '084760', '1、首页抢救及成功次数、血型未写；2、主治医师书写入院记录应直接写“入院诊断”，而非写“初步诊断”；3、术前小结与上级医师查房应分开；4、多处医嘱无有执业资格医师签字；5、病程无会诊记录（2次），5.4会诊记录过简，会诊单无二线签字；6、尿常规、肝功异常未复查；7、输血1000ml无输血同意书（单项否决）；8、病危无抢救记录。（乙级）', null, '80分   （乙级）单项否决一项', '扣0.3分', '83ceee4c-61e7-11e2-975d-5cff350bc903');
