INSERT INTO `input` VALUES ('3169', '苏砍', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.04', '080508', '1、家族史描述过简；2、体检缺对表情、体位、查体合作等的描述；3、表格病历空缺两项；4、入院记录中出院诊断上级医师未签名；5、超线使用二线抗生素头孢西丁；6、血糖、肌酐升高未分析原因，未复查。', null, '91分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3170', '潘凡', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.04', '081620', '1、主诉中用“人事不清”术语不规范；2、缺月经史；3、婚育史书写格式不规范；4、家族史过简；5、缺表情、体位；6、入院记录对意识的描述与首程不符；7、入院记录体检中“耳、鼻、脊柱、四肢见首程”不规范；8、缺低钾血症的诊断；9、病危通知单应粘贴到首页；10、抢救记录无主治医师在场；11、麻醉前访视无麻醉医师签字；12、术后小结不能与会诊记录合并一块写；13、出院未报上级医师；14、疑难危重病历讨论无主任签字；15、手术记录无手术医师签字；16、超线使用三线抗生素阿莫西林舒巴坦；17、导尿患者未查尿常规；18、出院记录无上级医师签字；19、住院病历有空格。（乙级）', null, '72分  乙级', '扣0.3分', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3171', '林建滨', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.04', '080200', '1、入院死亡记录过简；2、死亡讨论分析记录过简；3、长、短期医嘱无有执业医师资格者签名。', null, '88分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3172', '苏砍', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.04', '081460', '1、病史叙述层次不清；2、上级医师查房记录分析记录过简；3、无尿常规检查。', null, '93.5分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
