INSERT INTO `input` VALUES ('3174', '张桂坤', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.12', '0813172', '1、首页中损伤中毒的外部因素未写，出院诊断中5个其它诊断出院情况未填；2、上级医师查房记录分析过简；3、缺11.9行政值班人员签名记录；4、耳鼻喉科气管切开术“利多卡因”浓度写成1%。', null, '94.3分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3175', '苏砍', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.12', '0812885', '1、病程记录中上级首次查房缺鉴别诊断及诊疗计划；2、手术同意书只有家属签名，无委托书。', null, '93分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3176', '潘凡', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.12', '0812724', '1、首页出院诊断不全；2、入院当日为明确脑挫裂伤转归情况复查CT，CT回报后无分析（与伤时比较），“左额硬膜外血肿”补充诊断无记载及分析；3、病历第一页空行。', null, '94分', '0', '83d126e5-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3177', '刘才文', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.12', '0812967', '1、现病史疾病诱因、发展叙述过简；2、首程专科体检过简；3、首程诊断依据过简，诊疗计划无扩血管计划及用药，会诊记录与上级医师意见写在一起，辅助检查分析欠详；4、医患协议书医师未签名。', null, '92分', '0', '83cedb94-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3178', '彭永挑', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.12', '0812761', '1、诊断依据欠充分；2、治疗欠规范；3、病程存在拷贝现象；4、辅助检查分析不全面；5、签名字迹潦草；6、贵重药品无签名。', null, '92分', '0', '83cedb94-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3179', '赖松银', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.12', '0812409', '1、现病史中未描述病情进展情况；2、首程拷贝现象严重，未能体现病例特点；3、首程诊疗计划较简单；4、医嘱中多处药物剂型未写。', null, '94分', '0', '83cedb94-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3180', '付保忠', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.12', '0812932', '1、首页中漏项未填；2、主诉欠完整，病史中有错别字，症状、体征加重描述欠详；3、腹部体征描述欠详细、规范；4、缺心电图诊断；5、病程中原发性肝癌诊断明确，有乙肝而不是乙肝病毒携带者，肝硬化失代偿期明确，不能排除肝硬化等。6、字迹潦草。', null, '90分', '0', '83cee2e7-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3181', '蔡河清', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3d46-61e5-11e2-975d-5cff350bc903', '2008.12', '0812720', '1、疾病发展变化过程描述不清；2、术后前三天患者主诉疼痛程度描述含糊不清；3、术前讨论记录、手术知情同意书中的手术医师为“洪海填”，而手术记录、术前小结中的手术医师为“林晓青”很混乱；4、短期医嘱涂改一处；5、抗菌素使用达6天，超过规定时限，不合理用药。', null, '93.5分', '0', '83d12eff-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3182', '刘丽玉', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c3b22-61e5-11e2-975d-5cff350bc903', '2008.12', '0813085', '1、病程记录欠详；2、住院病案评定记录表患者姓名、科别、床号、住院号等一般项目未填。', null, '95分', '0', '83d11f9f-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3183', '邓玉林', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.12', '0812969', '1、体检缺体位、表情描述，“闻及干湿性罗音”，描述不具体；2、抗生素使用不合理：疗程过长，频繁更换（青霉素、头孢曲松、克林霉素）；3、首程拷贝现象严重，不能反映病例特点；4、首程鉴别诊断简单，上级医师查房部分存在拷贝现象；5、未复查血常规；6、出院带药未写入出院记录中。', null, '91.5分', '0', '83ced4fb-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3184', '朱冰封', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.12', '0812508', '1、首页背面空项；2、病程前后主诉前后矛盾，先写“发热、咳嗽、气促2天”，后又写“发热、咳嗽、气促6天”；3、尿粪常规病程无记录；4、出院医嘱写“不适随诊”，交代不明确。', null, '91分', '0', '83ced4fb-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3185', '陈魁夫、李根智', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.12', '0812647', '1、信息填写不真实（首页地址和入院志地址不符）；2、主诉不完整（未体现左膝、左小腿出血，活动障碍）；3、专科检查不全面（缺健侧肢体描述）；4、抗生素应用6天不合理（预防用药）；5、病历眉栏缺项（手术同意缺床号、上级医师签名）。', null, '95.8分', '0', '83ceee4c-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3186', '卢依刚', '621d9d05-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.12', '0812580', '1、首页填写不规范（手术或操作部），不整洁；2、首程诊断依据、病史未提膀胱癌手术史；3、上级医师查房分析欠缺；4、辅助检查CT或MRI未作；5、住院证一般项目有部分漏填。', null, '92分', '0', '83ceee4c-61e7-11e2-975d-5cff350bc903');
