INSERT INTO `input` VALUES ('3540', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c340a-61e5-11e2-975d-5cff350bc903', '2008.06.13', null, '一、1、无质量控制标准；2、无质量改进措施；3、无科室质量自查记录；4、无住院病人临床随访记录；5、无疑难病例集中讨论制度；6、无业务学习记录；7、心电图报告承诺发放制度及相关便民措施；8、心电图报告审核制度；9、应急预案和意外事故预防抢救措施；10、各类设备的标准操作、维护规程；11、各类设备的定期养护记录。（以上各项暂未形成文字材料，需严格整改）二、目前暂无心电图主治医师。', null, '不合格', '扣0.5分', '83cf0a00-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3541', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c242b-61e5-11e2-975d-5cff350bc903', '2008.06.13', null, '1、人员问题：随着临床工作量的增大，B超现有的人员安排较为紧张；2、工作站问题：超声影像的存储量极为有限，只能暂存最近三个月的影像数据，对后续的随访工作带来一定的影响；3、仪器上两牌：①养护人②固定资产牌；4、设备保养记录：将由设备科统一分发，包括医疗设备使用、保养、维修记录。', null, '不合格', '扣0.15分', '83ced010-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3542', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c32f1-61e5-11e2-975d-5cff350bc903', '2008.06.13', null, '1、住院病人临床随访记录：例数偏少；2、无放射人员体检结果；3、《大型仪器设备上岗证》、《放射工作人员证》还未依照科室人员现行编制要求一一具备；4、无洗片液处理流程；5、无仪器标牌；6、温度计、湿度计、压力表应定期校正（设备科牵头做）；7、应建立库存管理制度，对胶片、造影剂的存放应达到合理、有序的要求。', null, '不合格', '扣0.1分', '83cf0946-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3543', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c3805-61e5-11e2-975d-5cff350bc903', '2008.06.13', null, '1、要建立健全标本签收制度，做到与临床相符的标本签收记录；2、对现有或即将开展的全新检测项目要及时深入临床做好宣传、推广工作，更新《检验手册》，下发至每一位临床医师手中；3、建议血库与中心血站库容联网，建立出库入库记录。', null, '不合格', '扣0.05分', '83d119c4-61e7-11e2-975d-5cff350bc903');
