INSERT INTO `input` VALUES ('3864', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c4396-61e5-11e2-975d-5cff350bc903', '2008.08.31', '科周会记录本', '无科室工作落实情况和工作安排', null, '不合格', null, '83d145bf-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3865', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c34fe-61e5-11e2-975d-5cff350bc903', '2008.10.06', null, '1、值班医师呼吸机使用欠熟练；\r\n2、输液登记本不规范。\r\n', null, '不合格', null, '83d112be-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3866', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c3c1f-61e5-11e2-975d-5cff350bc903', '2008.10.06', null, '1、科周会补至2008年7月19日；\r\n2、2008年医疗纠纷登记本写在两本上（应为一本）；\r\n3、医生交接班本书写过简，新入病人未按规定书写；\r\n4、科室三基考试9月份不全，缺个别医师。\r\n', null, '不合格', null, '83d12bd0-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3867', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c2a0f-61e5-11e2-975d-5cff350bc903', '2008.10.06', null, '1、死亡病例交接班本写自动出院；\r\n2、病危、血压下降患者无抢救记录。\r\n', null, '不合格', null, '83ceddfc-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3868', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c2b12-61e5-11e2-975d-5cff350bc903', '2008.10.06', null, '有抢救记录，交接班本未体现。', null, '不合格', null, '83cee5db-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3869', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c2fb0-61e5-11e2-975d-5cff350bc903', '2008.08.31', null, '1、科室人员资料：缺林川；\r\n2、6月5日有死亡患者，交接班本未写；\r\n3、交接班本书写过简，术后情况书写过简，10月2日交接班本眉栏空缺；\r\n4、三基考试缺8、9月份。\r\n', null, '不合格', null, '83cef19f-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3870', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c2900-61e5-11e2-975d-5cff350bc903', '2008.08.31', null, '1、抢救患者无病重、病危通知；\r\n2、医生办公室有黄色塑料垃圾桶。\r\n', null, '不合格', null, '83ced813-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3871', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c4160-61e5-11e2-975d-5cff350bc903', '2008.08.31', null, '1、科室人员资料：缺部分职称证书、毕业证书、资格证书、执业证书；\r\n2、质控资料：自查部分及整改措施拷贝，不能体现整改效果；\r\n3、抢救记录本：缺；\r\n4、业务学习本：每月缺一次（要求大于5人的科室每月至少两次）。\r\n', null, '不合格', null, '83d13a3b-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3872', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c4290-61e5-11e2-975d-5cff350bc903', '2008.10.06', null, '1、术前讨论：无证医师应写为“试用医师”，无下级医师签字的上级医师不能用红笔签字；\r\n2、质控本参加人员栏无医师手签。\r\n', null, '不合格', null, '83d13f65-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3874', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c340a-61e5-11e2-975d-5cff350bc903', '2008.11.22', null, '1、心电图图像报告单无患者姓名等一般项目；2、心电图申请单中检查报告的心电图号未填。', null, '不合格', null, '83cf0a00-61e7-11e2-975d-5cff350bc903');
INSERT INTO `input` VALUES ('3876', null, '621da5b4-61e5-11e2-975d-5cff350bc903', '7c7c32f1-61e5-11e2-975d-5cff350bc903', '2008.11.22', null, '暂未发现问题。', null, '合格', null, '83cf0946-61e7-11e2-975d-5cff350bc903');
