INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '耳鼻咽喉科', '蔡河清', '2008.08', '86911', '1、首页信息填写不全；2、主诉主要症状描述简单；3、出院诊断无上级医师签名；4、Ⅱ/甲切口，预防性使用抗生素时间过长，使用阿奇霉素时间7天，出院带头孢氨苄4天，不合理；5、诊疗计划简单，病程记录写“激素”不规范；6、医嘱多处药物未写剂型，医师签名难辨认。', '86.5分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db506f0-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
