INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '内一病区', '程海洋', '2008.06', '84782', '1、首页联系人地址填“同上”；2、住院18天，血压不同天超过140/90mmHg 6次以上，未记录、未分析、未诊断；3、体征中摔倒数次具体情况未描述；4、会诊记录过简，4月30日会诊记录未写请哪个科室会诊；5、临时医嘱中护士在医师签名栏签名，长期医嘱中无有执业资格医师签名；6、长期医嘱中复方氨基酸仍注明产地，且无使用指征；7、胸痛描述简单；8、发病诱因与第一诊断无明显关联，发病诱因是外伤，诊断是冠心病；9、三级护理仍绝对卧床不合理。（乙级）', '83/58分   乙级\n', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4e521-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '内一病区', '程海洋', '2008.05', '82904', '1、现病史中既往有无高血压病史欠详；2、局部体检欠详；3、白细胞升高明显，未诊断感染，高血压病未诊断；4、治疗不合理：①鼻饲病人开非洛地平缓释片，②血压16：00为190/120mmHg，18：00为121/92mmHg，治疗不合理，③预防性用左氧氟沙星，二线未签字；5、病程记录中白细胞升高未分析原因，一直书写预防感染，血压波动大未分析明确原因，主任查房记录未签字；6、胸片未拍，血常规白细胞异常未复查，尿潜血未复查；7、患者自动出院家属签字未写关系。', '87.5分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4e521-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
