INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '儿科', '黄   教', '2008.07', '86252', '1、首页病案号涂改，户口地址简写，应写到门牌号，电话写“不详”；2、原诊治过程记述不清，症状特点描述不全面；3、体检中头颅前后囟未描述，“五官端正”不规范；4、缺“贫血”诊断；5、中级以上医师书写入院记录应写“入院诊断”，而非“初步诊断”；6、抗生素应用依据不足，无药敏记录及痰培养记录；7、病程记录中上级医师查房记录未对实验室检查结果进行分析；8、病程记录中更换抗生素未分析；9、频繁更换抗生素；10、医嘱书写不规范，字迹潦草。', '83.6/59   乙级', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
