INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '黄献来', '2008.07', '86003', '1、首页中患者职业写工人，工作单位及地址未填；2、入院记录一般项中职业与工作单位写无，与主诉、现病史及首页矛盾；3、首页药物过敏史应写“未发现”；4、首程诊疗计划中预防感染、活血化瘀应写出具体药名及剂量；5、上级医师查房分析记录过简；6、出院前连续七天无上级医师查房；7、出院前一天无上级医师查房；8、出院无上级医师意见；9、辅助检查结果未在病程记录中记录分析；10、6.4用红花注射液未在病程记录中记录体现；11、出院记录单多处格式错误，多处标点错误，X片号、CT号及实习医师空缺，填写日期书写错误；12、超', '85分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '黄献来', '2008.1', '810223', '1、首页伤口愈合等级未填；2、患者有输血史，未记录原因；3、既往史前后矛盾，“既往素健”，又“有输血史”；4、既往史书写过简，未填外伤、手术情况；5、急性化脓性阑尾炎患者体位为“自动体位”；6、现病史描述记录过简，与疾病相鉴别的症状过少；7、鉴别诊断过简；8、首程缺“诊疗计划”四字，诊疗计划过简；9、病程中B超、胸透、腹痛等检查结果未记录，异常检查结果未分析；10、有血常规医嘱，无化验单。', '85分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
