INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '李春阳', '2008.07', '84760', '1、首页抢救及成功次数、血型未写；2、主治医师书写入院记录应直接写“入院诊断”，而非写“初步诊断”；3、术前小结与上级医师查房应分开；4、多处医嘱无有执业资格医师签字；5、病程无会诊记录（2次），5.4会诊记录过简，会诊单无二线签字；6、尿常规、肝功异常未复查；7、输血1000ml无输血同意书（单项否决）；8、病危无抢救记录。（乙级）', '80分   （乙级）单项否决一项', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '李春阳', '2008.08', '87104', '1、首页主治医师栏空缺；2、药物过敏史栏写“无”，应写“未发现”；3、入院记录未填科室；4、病史中疼痛的性质，持续时间均未描述，鉴别资料不足；5、化脓性阑尾炎术后用“头孢噻肟钠+奥硝唑+左氧氟沙星”三联抗生素，欠妥；6、患者有黑便但病程无分析；7、术前有心电图检查，但未见报告单；8、麻醉会诊单请麻醉会诊科室所有要求填写项目未填；9、手术同意书患者家属与患者的关系及日期未填；10、主治医师查房记录未审签病历2次；11、医嘱多处未写药品剂型。', '82分   乙级', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
