INSERT INTO `sheet1` VALUES ('病历书写', '运行病历', '外科', '李春阳', '2008.05.14', '84760', '1、主诉错用标点；2、主诉写“胸部、腹部多处疼痛”，现病史写“无腹痛”，前后矛盾；3、现病史中写“在外未处理处理后”，打印错误；4、缺与主要疾病有鉴别意义的阴性资料，如有无心悸、胸闷等；5、上级医师未及时审签病历。', '不合格', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('病历书写', '运行病历', '外科', '李春阳', '2008.06.13', '86333', '1、上级医师查房记录不能体现上级医师的意见，与首程一模一样；2、尿检查有白细胞及心电图异常未在病程中记录分析；3、不合理用药：无菌手术预防性用三代头孢5天，用氨基酸7天；4、首程中描述病史不确切，体检不详细，对肿物描述不清；5、鉴别诊断分析不够；6、诊疗计划过简。', '不合格', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
