INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '李根智', '2008.06', '84278', '1、出院记录上级医师修改未签字；2、出院记录拷贝转入记录内容，诊疗过程不全；3、长期医嘱中饮食医嘱不规范，应写“流质饮食”；4、营养药应用欠合理；5、对次要诊断无处理意见；6、现病史中主要疾病发展变化过程描述不清；7、标点符号错误，病程中对目前诊断用“”；8、4.28上级医师查房记录无住院医师签字；9、病程中病史、体检部分存在拷贝现象；10、上级医师查房记录及病程中诊断依据反复拷贝，且重点不突出；11、化验单粘贴不规范。', '85分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
