INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '外科', '李根智', '2008.09', '89229', '1、术前小结欠规范，未写注意事项；2、术后使用复方氨基酸4天，无指征；3、缺术前胸透（片）检查；4、病程记录分析记录过简。', '89分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
