INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '眼科', '马   榕', '2008.08', '87206', '1、首页损伤中毒的外部因素写“/”，未填写原因；药物过敏史填“/”，应写“未发现”；2、主诉描述不确切；3、病史描述层次不清；4、首程记录不全、不规范，完善检查不具体；5、上级医师查房分析过简；6、术后记录不足，术前小结不规范，手术记录过简；7、7.1上级医师查房未审签；8、辅助检查单粘贴不规范。', '87.5分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db50115-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
