INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '潘   凡', '2008.07', '85633', '1、首页副主任医师栏空缺；2、病史中主要症状缺具体客观描述；3、体检中使用（-）代替阴性体征，对四肢挫擦伤创面缺乏客观描述；4、诊断头皮血肿，但无体征；5、5.21用左氧氟沙星、雷尼替丁及肺力咳合剂，病程中未记录及分析；6、抗生素使用无指征；7、首程缺上级医师签名；8、最后一次病程记录中无头皮血肿及四肢挫擦伤的转归；9、护理记录与病程记录不符合，护理记录写患者很长一段时间不在病房，但病程记录中未写。（乙级）', '86.5/58.5  乙级\n', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '潘   凡', '2008.06', '82704', '1、首页缺副主任医师签字；2、首程及抢救记录无上级医师签字；3、病程记录中眼科会诊记录漏字，写患者名字为“田军”；4、病程记录分析记录过简；5、病程记录中对辅助检查结果记录过简或无分析；6、越级使用三线抗生素“阿莫西林舒巴坦钠”。', '89分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '潘   凡', '2008.1', '810695', '1、入院记录第一页有空格；2、首程拷贝现病史，无病例特点；3、9.16上级医师查房分析意见重点不突出；4、9.21同一时间8：40开两次三级护理，未分析；5、9.22医嘱取消不规范；6、患者已于9.20做大便常规检查，9.23病程记录及出院记录中仍叫患者签字拒绝大便常规检查。', '89分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '潘   凡', '2008.08', '87468', '1、患者未出现感染征象，连续使用抗生素4天；2、停用抗生素病程中无反应；3、首程中诊断依据写“被击打致头痛、头晕”，而入院记录及首程中主诉写“摔伤致头痛、头晕”；4、缺清创记录；5、上级医师查房内容分析雷同；6、最后一次病程记录无上级医师签字；7、诊疗计划未具体写出药物名、剂量及作用。 ', '90分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
