INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '潘凡', '2008.04', '81620', '1、主诉中用“人事不清”术语不规范；2、缺月经史；3、婚育史书写格式不规范；4、家族史过简；5、缺表情、体位；6、入院记录对意识的描述与首程不符；7、入院记录体检中“耳、鼻、脊柱、四肢见首程”不规范；8、缺低钾血症的诊断；9、病危通知单应粘贴到首页；10、抢救记录无主治医师在场；11、麻醉前访视无麻醉医师签字；12、术后小结不能与会诊记录合并一块写；13、出院未报上级医师；14、疑难危重病历讨论无主任签字；15、手术记录无手术医师签字；16、超线使用三线抗生素阿莫西林舒巴坦；17、导尿患者未查尿常规；18', '72分  乙级', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
