INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '苏茂', '2008.09', '88539', '1、现病史漏字；2、意识朦胧体检写“无压痛、无叩痛”，不真实；3、首程中“长度”写为“长都”多处；4、7.24  9：00病程记录“呼吸困难”写为“呼吸困囊”；5、7.24  12：00病程记录“迟发出血”写为“迟发出现”；6、病程记录中“mmHg”写为“mmnHg”；7、术前小结无上级医师签字；8、副主任医师查房两次未签名；9、7.24临时医嘱无有执业资格医师签字（至少5处）；10、7.25临时医嘱无医师签字一次；11、更换抗生素未说明理由；12、头孢西丁钠使用时间过长7天（7.24-7.31）；13、', '73.5分  乙级', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
