INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '神经外科', '苏茂', '2008.1', '89979', '1、首页中血型未填；2、低血钾未处理；3、首程中未写鉴别诊断；4、诊疗计划漏写心电监护、吸氧；5、部分病程记录T、P、血氧饱和度无记录；6、CT报告未见正式报告单；7、医嘱未顶格书写；8、入院记录有空格；9、开放性颅脑损伤应为易感因素，院感表中未填。', '89分', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
