INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '骨一病区', '王生', '2008.1', '810079', '1、抗生素使用不合理；2、耳鼻喉科会诊情况未写；3、出院记录拷贝出现严重错误，出院小结已拆线，病程未体现；4、陈永春副主任医师查房写为“主任医师”；5、医嘱涂改多处，剂型未写；6、住院病案病历评定表未填；7、出院小结写“Ⅱ/甲”愈合，而病案首页写“Ⅰ/甲”愈合；8、手术同意书涂改严重，手写与电脑打印并用。（乙级）', '83分   乙级病历', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db50fcd-1cf8-11e3-bcc9-70f39533446d', 'MB', '2');
