INSERT INTO `sheet1` VALUES ('病历书写', '运行病历', '耳鼻咽喉科', '阳海林', '2008.08.21', '89257', '1、上级医师查房分析记录过简；2、首程中对院前治疗描述过简；3、无授权委托书；4、声带小结手术使用三线抗生素；5、住院10天无大便常规；6、8.21上级医师查房记录无上级医师签字。', '不合格', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db506f0-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
