INSERT INTO `sheet1` VALUES ('病历书写', '出院病历', '儿科', '朱冰', '2008.06', '84342', '1、病史中痰的性状、多少未描述，缺鉴别诊断症状；2、体检缺体位、表情、周围血管征；3、主要诊断错误，出院记录缺“腮腺炎”诊断；4、腮腺炎未报传染病（单项否决）；5、抗生素应用不合理，超线使用二线抗生素“头孢呋辛”、“头孢曲松”、“阿奇霉素”；6、病程记录分析记录过简，对实验室检查结果无分析、记录，更改抗生素无分析、记录；7、部分检查结果异常未复查；8、对激素、脑细胞营养药应用依据不足；9、入院记录中入院诊断、出院诊断无上级医师签字。（乙级）', '82分   乙级', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '1');
