INSERT INTO `sheet1` VALUES ('病历书写', '运行病历', '儿科', '朱冰', '2008.11.22', '813120', '1、首程病史特点及诊断依据均拷贝现病史；2、血常规：WBC：25.70×109/L，而11.9病程分析却写血象不高；3、抗生素使用不合理，未行血培养、咽拭子培养等，发热已退更换抗生素依据不足；3、缺肺部视触叩情况，入院诊断与初步诊断相同时，无需再写入院诊断；4、病历拷贝现象严重。', '不合格', '0def29ba-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
