INSERT INTO `sheet1` VALUES ('等级护理', '', '神经外科', '', '2008.2.26', '', '病人总数28人，一级护理查3人。344床：2.26护理记录单主诉仍缺，病人指甲长；周围静脉留置管敷料脏，未更换，氧气筒无四防标志，输液架同时挂两瓶液体，一瓶未输。322床：护理记录单书写涂改，首次口腔护理未写消毒液名称，病人指甲长，输液架同时挂两瓶液体，一瓶未输，留置针渗液，周围皮肤肿胀。317床：2.26护理单0.5%碘伏写成0.2%，护理记录无说明目的，地板脏。', '91.6分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '内一病区', '', '2008.1.25', '', '401床（病重）1、氧气导管固定不规范，2、床单元不整洁，3、心电监护仪等各线无整理好。409床 一级护理 1、床头卡放床头，应在床尾，2、碘伏消毒棉签置于床头及窗台上，3、指甲长，4、手垫（患者昏迷）湿掉，床单有血迹，5、未穿患服，病人服湿掉未更换，6、外用静脉留置针固定不规范，7、病人手卫生较差。422床 一级护理 1、外周静脉留置针不规范，2、患者手较脏，3、外周静脉留置针无标志留置时间，服帖无更换，较脏，4、指甲长，5、无床头卡。', '93.3分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4e521-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '妇产科', '', '2008.2.26', '', '病人总数90人，一级护理查3人。707床：特护单2.13病情记录与时间不对格；2.21 09：10生命征记录不完整，改一级护理无转危重及画红线；床单、尿管有血迹，病人指甲长。713床：2.21 06：30改一级护理无转危重及画红线；病人头发脏，指甲长；伤口外阴周围有血迹。', '93分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4f0e5-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '内二病区', '', '2008.2.26', '', '病人总数31人，病重2人，一级护理1人。A419床：2.25医嘱皮试阴性，体温单未记录，尿量记录无C标志，气垫床铺反，床单有血迹。A424床：2.18 20：00护理书写不完整，2.19护理书写出格，病人9天无大便，护理记录单无宣教记录，病人指甲长，床单有碎屑。A403床：未发现问题。', '93分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4e6c2-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '内一病区', '', '2008.26.', '', '病人总数28人，一级护理查3人。407床：2.20体温单与护理记录单记录不符合，首程口腔护理记录单无消毒液名称，20/2入量记录不完整，病人指甲长，床头卡护理级别标志混贴，心电监护仪各线垂在地板上。423床：氧气筒贴胶布，病人无穿患服。442床：被套脏，患者对输液治疗药物不了解。', '93分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4e521-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '妇产科', '', '2008.1.25', '', '708床，一级护理 1、无输液巡视卡，2、患者指甲长。717床 一级护理  1、床单有血迹，2、无输液巡视卡，3、指甲长，4、术后（刚刚）病人卧位没协助卧好，太够床尾，病人不够舒适，5、病人大腿及会阴部有血迹。 A736床 一级护理  1、口腔护理无执行也没指导患者漱口，2、患肢有血迹较明显，3、尿管悬挂不正确，导尿管有血迹。', '95.3分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4f0e5-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '儿科', '', '2008.1.25', '', 'A513床 一级护理 1、座置于患儿床头，2留置针针头输液时未用胶布固定，3、吸氧管拉得太紧，4、床头卡与病孩不相符合（性别、姓名、年龄、诊断、等级标识等均有错），5、自家被、物品多。A517床（病重）1、床头卡等级标识错误（应为一级红色标志），2、床头电线太多（心电监护仪、微注泵等）未整理，3、输液针头未用胶布固定或采取保护措施。A525床 一级护理 1、床头较乱，未整理（整改床单元较乱），2、无输液巡视卡。', '95.5分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '儿科', '', '2008.2.26', '', '病人总数41人，一级护理查3人。A517床：护理记录单书写不整洁，床铺乱；A516床，首次口腔护理无书写消毒液名称，患儿盖自家被，血氧探头掉了；A519床：首次护理记录无入院诊断，床头心电监护仪各线无整理。', '95分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '外科', '', '2008.1.25', '', '518床 一级护理  床头卡等级标识不正确（写成二级标识），2、痰盂较脏，3、胃管固定不够规范。 513床 二级护理  1、床旁桌错位，2、病房空气混浊（陪护多）。542床 二级护理 1、备用的氧气筒未及时推回，2、消毒棉签放在创下的痰盂里，3、指甲较长，4、巡视卡年龄错误。501床 二级护理  1、床单有皱褶，不够平整，2、趾甲较长，3、外周静脉留置针未标明留置时间。524床  二级护理  1、床单不够平整，物品较多（自家被）。', '96.8分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '神经外科', '', '2008.1.25', '', '308床 一级护理 1、留置针无标志留置时间，2、心电监护血压探头夹法错误，3、消毒吸痰管的消毒液置于床底下。323床 一级护理 消毒用的棉签放在床头桌上。332床 一级护理 1、一级护理病人门反锁，危险！2、病房卫生较差（单人住），3、床单元不洁，4、头发较乱（女病人），5、指甲长，6、外周静脉留置针无标志置管时间，敷贴较脏，没更换，7、外周静脉留置针留置超过72小时，8、盖自家被。', '96分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
INSERT INTO `sheet1` VALUES ('等级护理', '', '骨二病区', '', '2008.1.25', '', '622床 二级护理  1、指甲长，2、将自家物品置于空床上及621床床旁桌。 626床 二级护理  1、指甲长，2、床头桌及地上（床底）有用过的棉签，3、床单较脏 。608床 二级护理  1、指、趾甲较长，2、床单较脏。A617床 二级护理  1、外周静脉留置针已留置5天，服帖没更换较脏。A601床  二级护理 指甲长。', '97分', '0def2c14-1cf9-11e3-bcc9-70f39533446d', '8db51396-1cf8-11e3-bcc9-70f39533446d', 'MB', '');
