INSERT INTO `sheet1` VALUES ('核心制度', '', 'B超室', '', '2008.06.13', '', '1、人员问题：随着临床工作量的增大，B超现有的人员安排较为紧张；2、工作站问题：超声影像的存储量极为有限，只能暂存最近三个月的影像数据，对后续的随访工作带来一定的影响；3、仪器上两牌：①养护人②固定资产牌；4、设备保养记录：将由设备科统一分发，包括医疗设备使用、保养、维修记录。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8daca82e-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '检验科', '', '2008.06.13', '', '1、要建立健全标本签收制度，做到与临床相符的标本签收记录；2、对现有或即将开展的全新检测项目要及时深入临床做好宣传、推广工作，更新《检验手册》，下发至每一位临床医师手中；3、建议血库与中心血站库容联网，建立出库入库记录。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4fd23-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '心电图室', '', '2008.06.13', '', '一、1、无质量控制标准；2、无质量改进措施；3、无科室质量自查记录；4、无住院病人临床随访记录；5、无疑难病例集中讨论制度；6、无业务学习记录；7、心电图报告承诺发放制度及相关便民措施；8、心电图报告审核制度；9、应急预案和意外事故预防抢救措施；10、各类设备的标准操作、维护规程；11、各类设备的定期养护记录。（以上各项暂未形成文字材料，需严格整改）二、目前暂无心电图主治医师。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4f7e6-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '影像科', '', '2008.06.13', '', '1、住院病人临床随访记录：例数偏少；2、无放射人员体检结果；3、《大型仪器设备上岗证》、《放射工作人员证》还未依照科室人员现行编制要求一一具备；4、无洗片液处理流程；5、无仪器标牌；6、温度计、湿度计、压力表应定期校正（设备科牵头做）；7、应建立库存管理制度，对胶片、造影剂的存放应达到合理、有序的要求。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4f61d-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', 'B超室', '', '2008.08.29', '', '1、7月份质控科检查存在问题质控本中未体现；2、业务学习无参加者签名。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8daca82e-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '检验科', '', '2008.08.29', '', '科室质控本未体现责任人，整改措施少，参会人员未签名。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4fd23-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '心电图室', '', '2008.08.29', '', '科室质控本参会人员未签名。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4f7e6-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '儿科', '', '2008.08.31', '', '1、抢救患者无病重、病危通知；\n2、医生办公室有黄色塑料垃圾桶。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4e3a9-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '骨一病区', '', '2008.08.31', '', '1、科室人员资料：缺部分职称证书、毕业证书、资格证书、执业证书；\n2、质控资料：自查部分及整改措施拷贝，不能体现整改效果；\n3、抢救记录本：缺；\n4、业务学习本：每月缺一次（要求大于5人的科室每月至少两次）。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db50fcd-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '外科', '', '2008.08.31', '', '1、科室人员资料：缺林川；\n2、6月5日有死亡患者，交接班本未写；\n3、交接班本书写过简，术后情况书写过简，10月2日交接班本眉栏空缺；\n4、三基考试缺8、9月份。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4ef88-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '妇产科', '', '2008.10.06', '', '1、科室人员资料：缺部分职称证书、毕业证书、资格证书、执业证书及上岗证；\n2、三基考试：未见；\n3、科周会记录本：部分未签字。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4f0e5-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '骨二病区', '', '2008.10.06', '', '1、术前讨论：无证医师应写为“试用医师”，无下级医师签字的上级医师不能用红笔签字；\n2、质控本参加人员栏无医师手签。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db51396-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '急诊科', '', '2008.10.06', '', '1、值班医师呼吸机使用欠熟练；\n2、输液登记本不规范。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4f93f-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '内二病区', '', '2008.10.06', '', '有抢救记录，交接班本未体现。', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4e6c2-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '内一病区', '', '2008.10.06', '', '1、死亡病例交接班本写自动出院；\n2、病危、血压下降患者无抢救记录。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db4e521-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
INSERT INTO `sheet1` VALUES ('核心制度', '', '神经外科', '', '2008.10.06', '', '1、科周会补至2008年7月19日；\n2、2008年医疗纠纷登记本写在两本上（应为一本）；\n3、医生交接班本书写过简，新入病人未按规定书写；\n4、科室三基考试9月份不全，缺个别医师。\n', '不合格', '0def2757-1cf9-11e3-bcc9-70f39533446d', '8db5054f-1cf8-11e3-bcc9-70f39533446d', 'MB', '0.5');
