INSERT INTO `t_per_record` VALUES ('0f79ee98-25f6-11e5-8cac-00163e0012d2', '', '2015-05-18', null, '患者颜金花，女，66岁。于2015年5月18日在门诊B区一楼北侧门口因雨天地板湿滑摔倒。即在急诊外科就诊，诊断：右桡骨下端骨折。给予包扎固定后，病人回家休息。 ', 'Ⅱ级事件', '', '7113a0ec-12c1-4dca-bf6f-9aab087e84d4', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '客服部钟健', '2b268fe2-c879-4571-84ab-20ff5b43119e', 'd6843137-a021-4edc-b661-147363776dcd', '', '10', '1.0');
