INSERT INTO `t_per_record` VALUES ('0f7a0265-25f6-11e5-8cac-00163e0012d2', '', '2015-05-21', null, '一病人家属反映因地面有水渍或尿液，在检验科抽血室外摔倒，后投诉到总值班，要求拍片检查。', 'Ⅲ级事件', '', '9c6c60ec-73ce-418f-914b-b70ab5048e3a', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '人事科杨万洪', '2b268fe2-c879-4571-84ab-20ff5b43119e', 'd6843137-a021-4edc-b661-147363776dcd', '', '11', '');
INSERT INTO `t_per_record` VALUES ('0f7a0be2-25f6-11e5-8cac-00163e0012d2', '', '2015-05-10', null, '亚重症病房290439陈德意，予5月10号22:20出现血氧饱和度下降，立即气管插管呼吸球囊辅助呼吸，当班某护士遵医嘱予将处于消毒状态的BP840呼吸机装好使用，使用过程中出现报警漏气，立即查找原因。立即将器械室已备好的处于备用状态的德尔格呼吸机使用，使用过程顺利，未再出现报警。', 'Ⅲ级事件', '', 'c140cb9a-a422-4b0f-bfde-4ece4e8158dd', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '临床使用人员在设备科工作人员指导下，再次连接管路，测试通过，设备故障消除。', 'af95bb16-e0c4-4cef-b25b-72a95b89d402', '3d0ee133-cded-4757-b35a-fc2cd70ecac6', '878ed583-be0a-4aa3-99d2-ab5c88c21301', '6', '');
INSERT INTO `t_per_record` VALUES ('0f7a1570-25f6-11e5-8cac-00163e0012d2', '林丽梅', '2015-06-01', null, '2015年6月1日，12：30，消毒供应部工人林丽梅在第二手术室清洗间进行肾镜手柄清洗时，使用干燥机对肾镜手柄进行干燥，造成肾镜手柄电源线损坏，不能正常使用。  ', 'Ⅲ级事件', '', 'bf6f9997-8a5a-4380-bb2c-d354a0feb6c3', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '技工室先进行维修，若实在无法修复，再联系厂家  ', 'af95bb16-e0c4-4cef-b25b-72a95b89d402', 'b7bb1f62-d09c-4a98-b695-6e1fb3e8d4d4', '10acbc08-ce64-4cbc-a822-fc728050e384', '9', '');
INSERT INTO `t_per_record` VALUES ('0f7a1fcb-25f6-11e5-8cac-00163e0012d2', '江华洁', '2015-06-04', null, '儿外563664杜为乐05床，男，1.6岁，今日行右侧鞘状突高位结扎术+右阴囊肿物切除术，术后吸氧过程中出现扶舒清氧气水接头与氧气表装置接头脱开，氧气水从流量表处喷出，溅撒到病室周围的墙壁上及病床上，少量喷到家属身上，家属受到一过性惊吓。  ', 'Ⅲ级事件', '', '5bdeb0c3-f31b-414e-bf03-344c95ca9357', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '患者在吸氧过程中不小心挤压到吸氧管且持续了一段时间，导致物理学上正常的泄压反应。第一时间将此事上报厂家技术部门，督促加快研发改进对中断吸氧警示的优化设计方案。协助科室制作了吸氧温馨提示卡，贴在每个氧气设备带的氧气出口处，提醒不要挤压，弯折鼻氧管及其他吸氧的注意事项。   ', 'af95bb16-e0c4-4cef-b25b-72a95b89d402', 'c408699b-343a-41e2-a7c2-344abf9495ee', '', '0', '');
INSERT INTO `t_per_record` VALUES ('0f7a6110-25f6-11e5-8cac-00163e0012d2', '陈幸', '2015-05-11', null, '下午16:00左右肾内科于彩超室给患者李春良行肾穿时，打开肾穿包后，发现包内缺少弯盘，影响肾穿的正常流程，妨碍无菌操作，这已经是第三次发现此情况。  ', 'IV级事件', '', 'bf6f9997-8a5a-4380-bb2c-d354a0feb6c3', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '肾穿包是由供应室打包消毒，供应临床使用。此事件已告知供应室蔡碧兰主任。经调查，肾穿包是使用后供应室回收清点时发现缺失弯盘，使用科室才告知打开使用时就没有弯盘。', 'af95bb16-e0c4-4cef-b25b-72a95b89d402', 'c408699b-343a-41e2-a7c2-344abf9495ee', '', '6', '');
