INSERT INTO `t_per_record` VALUES ('19c0db19-2634-11e5-8cac-00163e0012d2', '', '2015-04-26', null, '16:30分接西药房林泽元报15分钟前药房丢失20盒恩替卡韦，期间只有收废品的进入药房，接警后石耀煌 方贵扬 林泽元立即前往肺结核门诊旁的废品仓库找到嫌疑人 冯明春 女 龙海人 她承认到药房拉废纸箱纸盒拒不承认偷药。而后石耀煌在废品仓库小房间内找到一个黑塑料袋，内有20盒恩替卡韦，波立维 波立定 贺普丁 阿德福韦酯胶囊共计85盒药品 经药房工作人员确认药品价值9138.38元。嫌疑人承认是她拿的药品，已将情况汇报郑主任，后报中华所带走处理。已报总值班。', '', '', 'c37de69f-f59e-4550-9263-b5f4637e99f0', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '', '7672df45-1b26-483f-8d2a-07cacf749a97', '060e0964-4995-44e3-b27c-897880e4d738', '', '', '');
INSERT INTO `t_per_record` VALUES ('19c0e1d8-2634-11e5-8cac-00163e0012d2', '', '2014-04-16', null, '09：05分接科室领导称急诊7楼心外科.有一间医生办公室门被撬.后我班谢队.蓝碧参前去查看现场.是孔维生主任办公室门被踹开的.里面的柜子都被翻过.询问孔维生主任了解无丢失物品.后我班何长加前去中控室调阅监控查看无发现可疑情况.', '', '', '5340ffb9-05c6-4ca1-99db-680522babe08', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '', '7672df45-1b26-483f-8d2a-07cacf749a97', '0ca1df50-1c15-40d6-a57f-3e9161945460', '', '', '');
INSERT INTO `t_per_record` VALUES ('19c0e84d-2634-11e5-8cac-00163e0012d2', '', '2014-06-23', null, '00：19我班突然听到有人喊“抓小偷”。我班藍碧叁立即追出去，发现有两个嫌疑人一起提着有些东西，就要出地下车库出口，后我班李满发一起前去。被我们发现后两人放下东西跑了。我班把赃物（7根电缆）那到警务室，并报中华所处理。完我班报电工阿泗前来查看，经看是停车楼7楼的电缆。', '', '', '5bfda9c0-96c7-4457-97b0-c614a8f80bb3', 'a56a1e16-660c-440e-911d-20417b1db9ed', 'XDYY', '', '7672df45-1b26-483f-8d2a-07cacf749a97', '0ca1df50-1c15-40d6-a57f-3e9161945460', '', '', '');
